export const sortData = data => {
    const sortedData = [...data];
    console.log(sortedData)
    sortedData.sort((a, b) => {
        // if(a.cases > b.cases) {
        //     return -1;
        // } else {
        //     return 1
        // }
        return b.cases - a.cases;
    });
    return sortedData;
}
